function initSideNav(){var e=document.querySelectorAll(".ntg-side-nav__collapser");if(!e)return!1;for(var s=0;s<e.length;s++)e[s].addEventListener("click",function(e){e.preventDefault();e=this.parentElement.getElementsByClassName("collapse")[0];e.classList.contains("show")?(e.classList.remove("show"),this.classList.add("collapsed")):(e.classList.add("show"),this.classList.remove("collapsed"))})}$(document).ready(function(){initSideNav()});